/* Cambria Italic font converted for jsPDF */
import { jsPDF } from "jspdf";

(function (jsPDFAPI) {
  var callAddFont = function () {
    this.addFileToVFS("Cambria-Italic.ttf", "");
    this.addFont("Cambria-Italic.ttf", "Cambria", "italic");
  };
  jsPDFAPI.events.push(["addFonts", callAddFont]);
})(jsPDF.API);
